import React from "react";



const StatisticsTablePerson = ({personId, personName, revenue}) => {
    return (
        <tr>
            <td>{personId}</td>
            <td>{personName}</td>
            <td>{revenue}</td>
        </tr>
    );
}

const StatisticsTable = ({data}) => {
    return (
        <div>
            <table className="table table-bordered table-responsive" style={{ borderCollapse: 'collapse' }}>
                <thead>
                    <tr>
                        <th>ID společnosti</th>
                        <th>Jméno společnosti</th>
                        <th>Fakturované příjmy</th>
                    </tr>
                </thead>
                <tbody>
                    {data.map((item, index) => (
                        <StatisticsTablePerson key={index} personId={item.personId} 
                        personName={item.personName} revenue={item.revenue} />
                    ))}
                </tbody>
            </table>
        </div>
    );
};


export default StatisticsTablePerson;
